			<g id="textBottom">
				<rect x="1335.8" y="1030" class="st5" width="431" height="80.2"/>
				<text transform="matrix(1 0 0 1 1335.7578 1055.7549)"><tspan x="0" y="0" class="st6 st32">But they’re losing </tspan><tspan x="305.6" y="0" class="st33 st6 st32">tracks </tspan><tspan x="0" y="44.8" class="st6 st32">to the new Millenium</tspan></text>
				<rect x="1335.8" y="1123.6" class="st5" width="417" height="221.5"/>
				<text transform="matrix(1 0 0 1 1335.7578 1133.3447)"><tspan x="0" y="0" class="st1 st31">It makes sense that the Top 2000 will be more spread out for each new </tspan><tspan x="0" y="20.4" class="st1 st31">edition, since there are more songs to choose from. However, if we </tspan><tspan x="0" y="40.8" class="st1 st31">compare the distributions of the Top 2000 songs over 4 editions, we see </tspan><tspan x="0" y="61.2" class="st1 st31">that, especially, the 90’s has been gaining a lot of popularity. </tspan><tspan x="0" y="91.7" class="st1 st31">Even though all songs from the 90’s were out in the 2000 edition, only a </tspan><tspan x="0" y="112.1" class="st1 st31">few songs from that decade were chosen. Whereas in the 2016 edition </tspan><tspan x="0" y="132.5" class="st1 st31">the number of songs from the 90’s has risen significantly. This could be </tspan><tspan x="0" y="152.9" class="st1 st31">due to a new generation who has grown up during the 90’s taking over </tspan><tspan x="0" y="173.3" class="st1 st31">from those who voted in the early 2000’s (who apperantly didn’t </tspan><tspan x="0" y="193.7" class="st1 st31">appreciate the new music).</tspan></text>
				<rect x="49.4" y="1123.6" class="st5" width="203.4" height="222.3"/>
				<text transform="matrix(1 0 0 1 49.3979 1131.0918)"><tspan x="0" y="0" class="st34 st1 st18">The charts on the right represent all 2000 </tspan><tspan x="0" y="15.3" class="st34 st1 st18">songs from 3 past editions of the Top 2000 </tspan><tspan x="0" y="30.6" class="st34 st1 st18">(held in 2000, 2005, 2010) and the most </tspan><tspan x="0" y="45.9" class="st34 st1 st18">recent 2016 edition. </tspan><tspan x="0" y="69.3" class="st34 st1 st18">The songs are stacked according to their year </tspan><tspan x="0" y="84.6" class="st34 st1 st18">of release. The higher a rectangle, the more </tspan><tspan x="0" y="99.9" class="st34 st1 st18">songs that are in the Top 2000 list from that </tspan><tspan x="0" y="115.2" class="st34 st1 st18">release year.</tspan><tspan x="0" y="138.6" class="st34 st1 st18">The black dotted line represents a smoothed </tspan><tspan x="0" y="153.9" class="st34 st1 st18">curve over all 2000 songs. This makes the </tspan><tspan x="0" y="169.2" class="st34 st1 st18">comparison between the 4 charts easier.</tspan></text>
			</g>

				<rect x="503.3" y="911.5" class="st5" width="154.7" height="87.6"/>
				<text transform="matrix(1 0 0 1 503.2964 918.2773)"><tspan x="0" y="0" class="st1 st88">No other artist or band has more songs </tspan><tspan x="0" y="13.2" class="st1 st88">in the Top 2000 as the Beatles. With </tspan><tspan x="0" y="26.5" class="st1 st88">38 songs they are responsible for 14% </tspan><tspan x="0" y="39.7" class="st1 st88">of all titles before 1970. Nonetheless, </tspan><tspan x="0" y="53" class="st1 st88">only 5 years ago they still had 50 songs </tspan><tspan x="0" y="66.2" class="st1 st88">in the list.</tspan></text>

				<text transform="matrix(1 0 0 1 1144.1514 755.2021)"><tspan x="0" y="0" class="st1 st88">Passing away only days after the </tspan><tspan x="0" y="13.2" class="st1 st88">release of his new album </tspan><tspan x="99.3" y="13.2" class="st26 st88">Blackstar</tspan><tspan x="134.5" y="13.2" class="st1 st88"> on </tspan><tspan x="0" y="26.5" class="st1 st88">January 10th 2016. His legend </tspan><tspan x="0" y="39.7" class="st1 st88">remains strong with 26 songs in the </tspan><tspan x="0" y="53" class="st1 st88">Top 2000. His most popular song </tspan><tspan x="0" y="66.2" class="st26 st88">Heroes </tspan><tspan x="28" y="66.2" class="st1 st88">jumps from 34 to position 7.</tspan></text>
